import React from 'react';

function HomePage() {
  return (
    <div>
      <header>
        <h1>Welcome to My Development Site!</h1>
      </header>
      <section>
        <p>This is a great place to showcase my projects, skills, and interests in software development.</p>
      </section>
    </div>
  );
}

export default HomePage;
